  // c3: ambient, waterLevel, time, unused
  c3: vec4f,
  // c4: GROUND.rgb, SAND.r
  c4: vec4f,
  // c5: SAND.gb, GRASS.rg
  c5: vec4f,
  // c6: GRASS.b, ROCK.rgb
  c6: vec4f,
  // c7: SNOW.rgb, padding
